—Å—Ç–∞—Ç–Ω—å–æ.</p>
<p>–ê –≤–æ–Ω–∞ –π–æ–≥–æ, —Ç–∏–ø—É, –¥—É–∂–µ –ª—é–±–∏—Ç—å —ñ –Ω–µ —Ö–æ—á–µ —Ä–æ–∑–≤–æ–¥–∏—Ç–∏—Å—è, –∞–ª–µ –≤ –Ω–µ—ó —Ç–µ–º–ø–µ—Ä–∞–º–µ–Ω—Ç —ñ —ó–π –ø–æ–¥—Ä—É–≥–∞ –ø–æ—Ä–∞–¥–∏–ª–∞ –∑–∞–≤–µ—Å—Ç–∏ –∞–Ω–∫–µ—Ç—É –Ω–∞ —Å–∞–π—Ç—ñ –∑–Ω–∞–π–æ–º—Å—Ç–≤. –í–æ–Ω–∞ –¥–æ–≤–≥–æ –Ω–µ –Ω–∞–≤–∞–∂—É–≤–∞–ª–∞—Å—è, –ø–æ—Ç—ñ–º –≤–∏–ø–∏–ª–∏ –≤–∏–Ω–∞ –∑ –ø–æ–¥—Ä—É–∂–∫–æ—é —ñ –∑—Ä–æ–±–∏–ª–∏ —ó–π –∞–Ω–∫–µ—Ç—É. –Ü —Ç–µ–ø–µ—Ä –≤–æ–Ω–∞ —à—É–∫–∞—î —Å–æ–±—ñ –∫–æ—Ö–∞–Ω—Ü—ñ–≤. –í–æ–Ω–∞ —Ç—É—Ç –±–ª–∏–∑—å–∫–æ –Ω–∞ —Ä–∞–π–æ–Ω—ñ –±—ñ–ª—è –º–µ–Ω–µ –ø—Ä–∞—Ü—é—î, —è —ó—ó –ø–∞—Ä—É —Ä–∞–∑ –±–∞—á–∏–≤. –ó—É—Å—Ç—Ä—ñ–≤ –Ω–∞ –≤—É–ª–∏—Ü—ñ —ñ –ø–∏—Ç–∞—é —è–∫ —Å–ø—Ä–∞–≤–∏. –°–∫–∞–∑–∞–ª–∞, —â–æ –∑–Ω–∞–π—à–ª–∞ —Å–æ–±—ñ —Ç–∞–∫–æ–≥–æ —Å–∞–º–æ–≥–æ —á–æ–ª–æ–≤—ñ–∫–∞ —è–∫ —ñ –≤–æ–Ω–∞.</p>
<p>–¢–µ–∂ –æ–¥—Ä—É–∂–µ–Ω–æ–≥–æ, –π–æ–≥–æ —Ç–µ–∂ –∂—ñ–Ω–∫–∞ –Ω–µ –∑–∞–¥–æ–≤–æ–ª—å–Ω—è—î, –∞–ª–µ –≤–æ–Ω–∏ –Ω–µ —Ö–æ—á—É—Ç—å —Ä—É–π–Ω—É–≤–∞—Ç–∏ —Ä–æ–¥–∏–Ω—É. –¢–æ–º—É –≤–æ–Ω–∞ –∑ –Ω–∏–º –ø—Ä–æ—Å—Ç–æ —Ä–µ–≥—É–ª—è—Ä–Ω–æ —Å–ø–∏—Ç—å. –í—ñ–Ω –ø—Ä–∏—ó–∂–¥–∂–∞—î –Ω–∞ –º–∞—à–∏–Ω—ñ, –∑–∞–±–∏—Ä–∞—î —ó—ó, –∞ –ø–æ—Ç—ñ–º –ø—Ä–∏–≤–æ–∑–∏—Ç—å –Ω–∞–∑–∞–¥. –ê –æ—Å—Ç–∞–Ω–Ω—ñ–π —Ä–∞–∑ –±–∞—á–∏–≤ —ó—ó –≤–∂–µ —Ü—å–æ–≥–æ —Ä–æ–∫—É, —ñ –æ—Ç, –∫–∞–∂–µ –≤–æ–Ω–∞, —â–æ –∑ —á–æ–ª–æ–≤—ñ–∫–æ–º –Ω–∞—Ä–µ—à—Ç—ñ —Ä–æ–∑–ª—É—á–∏–ª–∞—Å—è —ñ —Ç–µ–ø–µ—Ä –Ω–∞—Ä–µ—à—Ç—ñ –≤—ñ–ª—å–Ω–∞.</p>
		
			
