	<p>–¢–∞–∫–∞ –¥—É–∂–µ —Ü—ñ–∫–∞–≤–∞ –∂—ñ–Ω–æ—á–∫–∞ –±—É–ª–∞. –ù–µ –¥—É—Ä–Ω–∞. –ë—É–ª–æ –ø—Ä–æ, —â–æ –ø–æ–≥–æ–≤–æ—Ä–∏—Ç–∏ —ñ –ø–æ—Ä–µ–≥–æ—Ç–∞—Ç–∏, —Ç–∞–∫–µ —Ä—ñ–¥–∫–æ –±—É–≤–∞—î. –©–µ —î –ø–∞—Ä—É –≤—ñ–¥—Å–æ—Ç–∫—ñ–≤, —Ç–∞–∫–∏—Ö, —â–æ –≤—ñ–¥—Ä–∞–∑—É –ø–∞—Ä–∞ —ñ —à—É–∫–∞—é—Ç—å –¥–ª—è —Å–µ–±–µ, –≤—ñ–¥–ø–æ–≤—ñ–¥–Ω–æ, —Ç–µ–∂ –ø–∞—Ä—É. –ü–∏—à—É—Ç—å, —â–æ "–º-–∂", —à—É–∫–∞—î–º–æ —Ç–µ–∂ –º–æ–ª–æ–¥—É –ø–∞—Ä—É —á–∏ –¥—ñ–≤—á–∏–Ω—É. –ù–µ –±–∞–≥–∞—Ç–æ, –∞–ª–µ —î. –Ø —Ä–∞–∑ —ó–º –¥–ª—è –ø—Ä—ñ–∫–æ–ª—É –Ω–∞–ø–∏—Å–∞–≤.</p><a id='d3'></a><h3>Account Options</h3><p>–Ü –≤–æ–Ω–∏ –º–µ–Ω—ñ –≤–∏—Å–ª–∞–ª–∏ —Å–≤–æ—ó –≤–∏–º–æ–≥–∏. –¢–æ–±—Ç–æ, —è–∫ –º–µ–Ω—ñ –ø–æ—è—Å–Ω–∏–ª–∏, —è–∫—â–æ —Ç–∏ –π–¥–µ—à –¥–æ –Ω–∏—Ö –æ–¥–∏–Ω, —Ç–æ –±—É–¥—å –≥–æ—Ç–æ–≤–∏–π, —â–æ —Ç–µ–±–µ, –ø–µ—Ä–µ–ø—Ä–æ—à—É—é, –≤ –¥—É–ø—É —ó—ó —á–æ–ª–æ–≤—ñ–∫ –±—É–¥–µ –≥—Ä–∞—Ç–∏. –ù—É —Ü–µ –≤–∂–µ –Ω—î. –ù–µ —Ö–æ—á–µ—Ç—å—Å—è. –©–µ –º–æ–∂—É —Å–∫–∞–∑–∞—Ç–∏, —â–æ –±—ñ–ª—å—à—ñ—Å—Ç—å, –≤—ñ–¥—Å–æ—Ç–∫—ñ–≤ –≤—ñ—Å—ñ–º–¥–µ—Å—è—Ç, —Ç–µ–ª–µ—Ñ–æ–Ω –Ω–µ –¥–∞—î - –Ω—ñ –ø—ñ—Å–ª—è –º—ñ—Å—è—Ü—è –ª–∏—Å—Ç—É–≤–∞–Ω–Ω—è, –Ω—ñ —Ç–∏–∂–Ω—è —á–∏ –¥–Ω—è. –ó–Ω–∞–π–æ–º–∞ —Ä–æ–∑–∫–∞–∑—É–≤–∞–ª–∞, —â–æ —ó–π —Å–ø—ñ–≤—Ä–æ–±—ñ—Ç–Ω–∏—Ü—ñ –Ω–∞—Å–∏–ª—å–Ω–æ –∑—Ä–æ–±–∏–ª–∏ —Å—Ç–æ—Ä—ñ–Ω–∫—É –Ω–∞ —Ç–∞–∫–æ–º—É —Å–∞–π—Ç—ñ. –Ü –∫–∞–∂–µ, —â–æ –ø—ñ–¥—Å—ñ–ª–∞. –ü–æ—Å—Ç—ñ–π–Ω–æ –∑–∞—Ö–æ–¥–∏—à, —è–∫—ñ—Å—å –ø–æ–≤—ñ–¥–æ–º–ª–µ–Ω–Ω—è¬†‚Äî —Ü—ñ–∫–∞–≤–æ.</p>
<p>–†–æ–∑–∫–∞–∑—É—é—Ç—å, —â–æ –º—î–Ω—Ç–∏ —á–∞—Å—Ç–æ —Å–∏–¥—è—Ç—å —Ç–∞–º –ø—ñ–¥ —Ñ–µ–π–∫–æ–≤–∏–º–∏ –∞–∫–∞—É–Ω—Ç–∞–º–∏. –ß–∏ —Ç–æ –¥–ª—è —Ä–æ–∑–≤–∞–≥–∏, —á–∏ —Ç–æ –¥–ª—è —Å–ª—ñ–¥—á–æ—ó —Ä–æ–±–æ—Ç–∏. –Ü –¥—ñ–π—Å–Ω–æ, —è —Ä–∞–∑ –∑–∞—Ö–æ–¥–∏–≤ –≤ ‚Ä¶ —Ä–∞–π–≤—ñ–¥–¥—ñ–ª, –ø–∏—Å–∞–≤ –∑–∞—è–≤—É —Ç–∞–º –ø–æ –æ–¥–Ω—ñ–π —Å–ø—Ä–∞–≤—ñ —ñ —Ä–µ–∞–ª—å–Ω–æ –ø–æ—á—É–≤ —É –Ω–∏—Ö –≤ –∫–∞–±—ñ–Ω–µ—Ç—ñ —Ö–∞—Ä–∞–∫—Ç–µ—Ä–Ω–∏–π –∑–≤—É–∫, –∑ —è–∫–∏–º –Ω–∞ —Å–∞–π—Ç—ñ –∑–Ω–∞–π–æ–º—Å—Ç–≤ –ø—Ä–∏—Ö–æ–¥—è—Ç—å –ø–æ–≤—ñ–¥–æ–º–ª–µ–Ω–Ω—è. –Ø –¥–∏–≤–ª—é—Å—å –Ω–∞ –º—ñ–ª—ñ—Ü—ñ–æ–Ω–µ—Ä–∞, –∞ –≤—ñ–Ω —Ç–∞–∫ –Ω–µ–∑–≤–æ—Ä—É—à–Ω–æ —Å–æ–±—ñ —â–æ—Å—å —Ç–∞–º –ø–∏—à–µ.</p>
